import React from 'react'
import Slider from "react-slick";

const Caro = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
    };
    return (
        <Slider>
            <div className='container'>
                {slideData.map(item => (
                    <div className='card'>
                        <div className='cardTitle'>
                            <h1>{item.fname}</h1>
                            <h2>{item.lname}</h2>
                        </div>
                        <div className='cardContent'>
                            <p>{item.age}</p>
                        </div>
                    </div>
                ))}
            </div>
        </Slider>
    );
}

